description:
Top Guns
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Fly hard with deep throttle action as Jesse Jane and Riley Steele show the men the true definition of hardcore power. They are the new top guns, the two best female fighter pilots the Airhas to offer going up against their arch rivals, Kayden Kross and Stoya, the unbeatable bitches from the Navy. It's lust-fueled girls going up against the hardest fly boys in the military to prove they've got more thrust in their game and more devious tactics than any enemy riding their tail.

Cast:   Kayden Kross   Jesse Jane   Riley Steele   Stoya   Selena Santana   Raven Alexis   Erik Everhard   Tommy Gunn   Mick Blue   Max Mikita   Frank Bukkwyd   Ben English   Scott Nails   Marcus London   Cody Bangs   Charles Dera 

